                        <ul>
                            <li class=""subitem1"">
                                <p>
                             ");
                WriteLiteral(@"       Most goldfish species are only suitable for keeping together. The reason is because these types of goldfish all share certain conditions, requirements for habitat, water sources, food and reproductive habits, so they can live in harmony. Do not keep three-tailed goldfish with fish that have fin predation properties.
